import React from "react";
import search from "../../images/search.png";
import notefic from "../../images/notification.png";
function Info() {
  return (
    <nav>
      <h1>
        Overview
        <div className="nav-items">
          <img src={search} alt="" />
          <img src={notefic} alt="" />
          <span className="arrow"></span>
          <h1>Jones Ferdinand
            <div className="img-rounder">
                <img src={pr} alt="" />
            </div>
          </h1>
        </div>
      </h1>
    </nav>
  );
}

export default Info;
